// src/pages/LandingPage.js
import React from 'react';
import { Link } from 'react-router-dom';

const LandingPage = () => {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gradient-to-br from-blue-100 to-white">
      <h1 className="text-4xl font-bold mb-6">Welcome to the Booking Portal</h1>
      <div className="space-x-4">
        <Link to="/login">
          <button className="px-6 py-2 bg-blue-600 text-white rounded-xl hover:bg-blue-700 transition">
            Login
          </button>
        </Link>
        <Link to="/register">
          <button className="px-6 py-2 bg-green-600 text-white rounded-xl hover:bg-green-700 transition">
            Register
          </button>
        </Link>
      </div>
    </div>
  );
};

export default LandingPage;
